 @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"79381","type":"CustomJS"},{"attributes":{},"id":"79582","type":"StringFormatter"},{"attributes":{},"id":"79443","type":"AllLabels"},{"attributes":{},"id":"79590","type":"StringFormatter"},{"attributes":{},"id":"79586","type":"StringFormatter"},{"attributes":{},"id":"79415","type":"AllLabels"},{"attributes":{"data":{"Close":{"__ndarray__":"UrgeheuUr0AzMzMzszqwQKRwPQrX1K1Aw/UoXI9QrUBSuB6Fa6StQOF6FK5HdK9Aj8L1KNx6rkDhehSuR8quQEjhehSuvq5AZmZmZuYTrkD2KFyPQiuvQArXo3A9EK9AcT0K1+MDsECuR+F6VCGwQOxRuB6F569AcT0K1yPir0DXo3A9SgKwQClcj8L1pq1AZmZmZuZXrUA9CtejcFitQPYoXI/C5qxAXI/C9ahWrUBI4XoULqStQAAAAAAAUq1AmpmZmZlsrUCuR+F6FEWtQHE9Ctej+apAw/UoXA/LqEDsUbgehYCnQFyPwvUovahASOF6FK69p0DhehSuR0qpQEjhehSuXqpAZmZmZmaXqUBSuB6F672pQKRwPQpXI6pAUrgehestqkDD9ShcDyypQM3MzMzMSKhAuB6F61GGqECF61G4nhipQHE9Ctcjq6VAUrgehWtDokCuR+F6lO6iQB+F61G4qKJAcT0K16OKo0C4HoXrUYmkQClcj8J1EqNAcT0K1yNTo0AUrkfh+kWkQClcj8L1SaRAZmZmZmb2pECPwvUo3J6lQAAAAACAA6VAPQrXo/CCpEAK16NwvQqnQFK4HoVrkadAexSuR+FXp0CuR+F6lLaoQJqZmZmZ4qdAZmZmZmYbqUCamZmZGeWoQAAAAAAAjqdAKVyPwnVCp0BI4XoULlCmQAAAAAAAwaZArkfhepRfqEDXo3A9ilmoQPYoXI9C1KZAw/UoXI/XpUBxPQrXI4ClQMP1KFyPyKRAzczMzMyepEBI4XoULjqkQNejcD0KvKRACtejcD29o0CkcD0K1+GkQBSuR+H636VA16NwPYpjpUBxPQrXo+ulQIXrUbgeE6dAAAAAAADgpkBcj8L1KAmmQBSuR+F64qRASOF6FC7UpEC4HoXr0XqkQJqZmZ
